import { Link } from "react-router-dom";
import ColorList from "./ColorList";

const HomeColor = ()=>{
    return (
        <div className="App">
          <h1>Color Picker</h1>
          <ul>
            <li><Link>pink</Link></li>
            <li><Link>red</Link></li>
            <li><Link>blue</Link></li>
          </ul>
        </div>
      );
}
export default HomeColor;
